import React from 'react'

export default function SearchResults(props) {

  const data = props.data.slice(0, 5);
  const inputLength = props.inputLength;

  if(inputLength >= 3 && props.clicked === false) {
    return (
      <div className="results">
        <div className="results__list" onClick={() => props.selected(true)}>
          <ul>
          {data.map((data, index) => {
            return (
                <li key={index}  id={data.id} onClick={() => props.selectionHandler(data.original_title)}>{data.original_title}
                  <span>{data.vote_average} Rating, {data.release_date.slice(0, 4)}</span>
                </li>
            )
          })}
          </ul>
        </div>
      </div>
    )
  }else{
    return null;
  }
}
